import "../stylesheets/Card.scss";

const Card = (props) => {
  return (
    <>
      <img
        className="item__img"
        src="https://img.europapress.es/fotoweb/fotonoticia_20110426171734_420.jpg"
        alt="Poly Styrene"
        title="Poly Styrene"
      />
      <h2 className="item__name">"Poly Styrene"</h2>
      <p className="item__description">
        Marianne Joan Elliott-Said (3 July 1957 – 25 April 2011),[1][2] known by
        the stage name Poly Styrene, was an English musician, singer-songwriter,
        and frontwoman for the punk rock band X-Ray Spex.
      </p>
    </>
  );
};

export default Card;
